import React from 'react';
import { Link } from 'react-router-dom';
import '../Styles/HomePage.css';

const HomePage = () => (
  <div className="home-container">
    <h1 className="home-title">Welcome to Open Source Project Finder</h1>
    <p className="home-desc">Discover open-source projects that match your skills and interests.</p>
    <Link to="/search" className="home-link">
      Start Searching
    </Link>
  </div>
);

export default HomePage;
